document.addEventListener("DOMContentLoaded", function () {
    window.cy = cytoscape({
        container          : document.getElementById("cy"),
        layout             : {name: "preset"},
        selectionType      : "single",
        boxSelectionEnabled: false,
        pixelRatio         : 1,
        hideEdgesOnViewport: true,
        textureOnViewport  : true,
        elements           : DATA,
        style              : [
            {selector: "node", style: {"font-size": "11px", "font-weight": 700, "text-valign": "center", "color": "#000"}},
            {selector: "node[t='VIRUS']", style: {width: 24, height: 24, "background-color": "#d8334a", label: "data(l)"}},
            {selector: "node[t='V_P']", style: {width: 24, height: 24, "background-color": "#ed5565", label: "data(l)"}},
            {selector: "node[t='Autoimmune']", style: {width: 24, height: 24, "background-color": "#ed79bb", label: "data(l)"}},
            {selector: "node[t='Neurological']", style: {width: 24, height: 24, "background-color": "#f6bb42", label: "data(l)"}},
            {selector: "node[t='Cardiovascular']", style: {width: 24, height: 24, "background-color": "#a4d441", label: "data(l)"}},
            {selector: "node[t='Pulmonary']", style: {width: 24, height: 24, "background-color": "#aa8e69", label: "data(l)"}},
            {selector: "node[t='Cancer']", style: {width: 24, height: 24, "background-color": "#c7ccd3", label: "data(l)"}},
            {selector: "node[t='Metabolic']", style: {width: 24, height: 24, "background-color": "#967adc", label: "data(l)"}},
            {selector: "node[t='G_O']", style: {width: 10, height: 10, "font-size": "7px", "background-color": "#fc6e51"}},
            {selector: "node[t='G_DP']", style: {width: 10, height: 10, "font-size": "7px", "background-color": "#2ecc71"}},
            {selector: "node[t='G_HT']", style: {width: 10, height: 10, "font-size": "7px", "background-color": "#3fbbe8"}},
            {selector: "node:selected", style: {"border-width": "4px", "border-color": "#3bf"}},
            {selector: "edge", style: {width: 1, "line-color": "#ccc", opacity: 0.2}},
            {selector: "edge.label", style: {"line-color": "#3bf", "opacity": 0.8}},
            {selector: 'node.label', style: {label: "data(l)", "border-width": "2px", "border-color": "#3bf"}},
        ],
    });
    window.cy.fit();
    window.cy.on("select", "node", function (evt) {
        var node = evt.target;
        node.addClass("label");
        node.neighborhood().addClass("label");
        node.connectedEdges().addClass("label");
    });
    window.cy.on("unselect", "node", function (evt) {
        var node = evt.target;
        node.removeClass("label");
        node.neighborhood().removeClass("label");
        node.connectedEdges().removeClass("label");
    });
    document.getElementById("cover").style.display = "none";
});
